import React from "react";
import Header from "../src/components/header/Header.components";

import { Features } from "../features/features.components";
import { Hot } from "../hot/hot.component";
import Category from "../category/category.component";
import {Forum} from "../forum/forum.component";
import {HeaderBox} from "../header.box/header.box.components";
import Footer from "../src/components/footer/footer.component";

import { Switch, Route } from "react-router-dom";

import "./App.scss";

const login = () => {
  return <div>log in page</div>;
};

function App() {
  return (
    <div className='App'>
      <Header />
      <HeaderBox />
      <Features />
      <Switch>
        <Route exact path='/login' component={login} />
        <Hot />
        <Category />
        <Forum />
      </Switch>
      <Footer />
    </div>
  );
}

export default App;
